import React from 'react';
import { Link } from 'react-router-dom';
import styles from './HomePage.module.css'; // Import CSS module

function HomePage() {
  console.log("Rendering HomePage"); // Debug statement

  return (
    <div className={styles.homePage}>
      <h1 className={styles.title}>WELCOME TO ZEN</h1>
      <p className={styles.description}>Select an option to get started:</p>
      <div className={styles.buttonContainer}>
        <Link to="/thoughts-villa">
          <button className={styles.homeButton}>Thoughts Villa</button>
        </Link>
        <Link to="/mood-tracker">
          <button className={styles.homeButton}>Mood Tracker</button>
        </Link>
      </div>
    </div>
  );
}

export default HomePage;
